import React from "react";
import "./NavBar.css";
const Navbar = () => {
  const navbuttonNames = [
    "Overview",
    "Profile",
    "Calender",
    "Attendance",
    "Documents",
    "Compensation",
    "Support",
  ];
  const navButtons = navbuttonNames.map((nb) => {
    return <span className="NavButton">{nb}</span>;
  });
  return <div className="NavBar">{navButtons}</div>;
};

export default Navbar;
